import { Routes, Route } from "react-router-dom"
import Bookings from "./pages/Bookings"
import Home from "./pages/Home"
import "./style.css"
import Homehoc from "./HOC/Homehoc"

function App() {
  return (
    <div className="App">
      <Routes>
        <Route
          path="/"
          Component={()=>{return (<Homehoc><Home/></Homehoc>)}}
        ></Route>
        <Route
          path="/bookings"
          Component={()=>{return (<Homehoc><Home/></Homehoc>)}}
        ></Route>
      </Routes>
    </div>
  );
}

export default App;
